    return (
        <div className="product-card">
            <h3>{product.name}</h3>
            <p>Pre√ßo: R${(product.price / 100).toFixed(2)}</p>
            <img src={product.imageUrl} alt={product.name} />
            <button>Adicionar ao Carrinho</button>
        </div>
    );
};

